  return (\nfunction(el, x){\n  var map = this;\n  map.whenReady(function(){\n    map._initialCenter = map.getCenter();\n    map._initialZoom = map.getZoom();\n  });\n}).call(this.getMap(), el, x, data);\n}","data":null},{"code":"function(el, x, data) {\n  return (\n  function(el, x) {\n    var map = this;\n\n// Función para abrir el popup del Sector A0\n   window.openSectorA0Popup = function(lat, lng) {\nL.popup()\n    .setLatLng([lat, lng])\n    .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./MiniMap.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n      \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Cueva Ana Te Pahu<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>En la cueva Ana Te Pahu, Roiho, se identificaron tres sectores con registros fósiles:<\/p>\" +\n      \"<p style='font-size: 14px; color: #34495E;'><b><a href='#' style='display: inline;' onclick='openSectorA1Popup(-27.1117067, -109.4041757)'>Sector A1<\/a><\/b>, \" +\n      \"<b><a href='#' style='display: inline;' onclick='openSectorA2Popup(-27.1117067, -109.4041757)'>Sector A2<\/a><\/b>, \" +\n      \"<b><a href='#' style='display: inline;' onclick='openSectorA3Popup(-27.1117067, -109.4041757)'>Sector A3<\/a><\/b>. \" +\n      \"<\/p>\"\n    )\n    .openOn(map);\n}\n\n\n// Función para abrir el popup del Sector B\n   window.openSectorBPopup = function(lat, lng) {\nL.popup()\n    .setLatLng([lat, lng])\n    .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./SectorB.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n      \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Sector Runga Va’e<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Sector Runga Va’e situado en la costa Este de Rapa Nui. Playa rocosa con grandes bloques de roca volcánica. Presenta un acantilado de 5 a 10 m de altura (<b><a href='#' style='display: inline;' onclick='openSectorB1Popup(-27.139335, -109.316497)'>RV1<\/a><\/b>).<\/p>\" +\n      \"<\/p>\"\n    )\n    .openOn(map);\n}\n\n// Función para abrir el popup del Sector A1\n   window.openSectorA1Popup = function(lat, lng) {\nL.popup()\n    .setLatLng([lat, lng])\n    .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./SectorA1.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n      \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Sector A1<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Se presentan 3 flujos de lava basáltica. La base corresponde a un flujo Pahoehoe de 1.6 m de potencia, tiene textura lisa y suave con marcas de fluidez. Suprayacente al flujo anterior, se presenta un flujo de lava de 1 m de potencia, donde se observan vesículas de 1 a 4 mm. Luego, suprayacente a este, se presenta un flujo de lava tipo AA con una potencia de 1.5 m el cual tiene textura áspera e irregular. En el flujo AA sobre el contacto se identifican tres hallazgos de interés paleobotánico (color rojo).<\/p>\" +\n      \"<p style='font-size: 14px; color: #34495E;'>Más detalles: \" +\n      \"<b><a href='#' style='display: inline;' onclick='openSectorA11Popup(-27.1117067, -109.4041757)'>Registro A1.1<\/a><\/b>, \" +\n      \"<b><a href='#' style='display: inline;' onclick='openSectorA12Popup(-27.1117067, -109.4041757)'>Registro A1.2<\/a><\/b>, \" +\n      \"<b><a href='#' style='display: inline;' onclick='openSectorA13Popup(-27.1117067, -109.4041757)'>Registro A1.3<\/a><\/b>. \" +\n      \"<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA0Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n    )\n    .openOn(map);\n}\n\n    // Función para abrir el popup del Sector A 1.1\n    window.openSectorA11Popup = function(lat, lng) {\nL.popup()\n        .setLatLng([lat, lng])\n        .setContent(\n       \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n       \"<img src='./SectorA11.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n        \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Registro A1.1<\/h2>\" +\n        \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Lava Tree mold dispuesto de manera horizontal, presenta un longitud aproximada de 2.62 m y un diámetro de 38.5 cm.<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA1Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n        )\n        .openOn(map);\n    }\n\n    // Función para abrir el popup del Sector A 1.2\n    window.openSectorA12Popup = function(lat, lng) {\nL.popup()\n        .setLatLng([lat, lng])\n        .setContent(\n       \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n       \"<img src='./SectorA12.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n        \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Registro A1.2<\/h2>\" +\n        \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Lava Tree mold dispuesto de manera horizontal sobre el flujo inferior, presenta 14 cm de diámetro y su extensión no fue posible medirla.<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA1Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n        )\n        .openOn(map);\n    }\n\n    // Función para abrir el popup del Sector A 1.3\n    window.openSectorA13Popup = function(lat, lng) {\nL.popup()\n        .setLatLng([lat, lng])\n        .setContent(\n       \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n       \"<img src='./SectorA13.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n        \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Registro A1.3<\/h2>\" +\n        \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Lava Tree mold dispuesto de manera horizontal sobre el flujo inferior, presenta 15 cm de diámetro y su extensión no fue posible medirla.<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA1Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n        )\n        .openOn(map);\n    }\n\n// Función para abrir el popup del Sector A 2\n    window.openSectorA2Popup = function(lat, lng) {\nL.popup()\n        .setLatLng([lat, lng])\n        .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./SectorA2.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n     \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Sector A2<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Se presentan 2 flujos de lava basáltica. La base corresponde a un flujo de basalto afanitico de 1 m de potencia. Presenta vesículas de 2 a 4 mm. Sobre este, se presenta un flujo de lava del tipo AA de 2 m de potencia. En el flujo de lava AA se identifican dos hallazgos de interés paleobotánico (color rojo).<\/p>\" +\n      \"<p style='font-size: 14px; color: #34495E;'>Más detalles: \" +\n      \"<b><a href='#' style='display: inline;' onclick='openSectorA21Popup(-27.1117067, -109.4041757)'>Registro A2.1<\/a><\/b>, \" +\n      \"<b><a href='#' style='display: inline;' onclick='openSectorA22Popup(-27.1117067, -109.4041757)'>Registro A2.2<\/a><\/b>. \" +\n      \"<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA0Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n    )\n        .openOn(map);\n    }\n\n\n    // Función para abrir el popup del Sector A 2.1\n    window.openSectorA21Popup = function(lat, lng) {\nL.popup()\n        .setLatLng([lat, lng])\n        .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./SectorA21.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n      \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Registro A2.1<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Lava Tree in situ, presenta una longitud de 1 metro, diámetro interno 32 cm y externo 53 cm. Corresponde a un registro in situ, indicando que no fue arrasado por el flujo de lava que lo formó.<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA2Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n        )\n        .openOn(map);\n    }\n\n    // Función para abrir el popup del Sector A 2.2\n    window.openSectorA22Popup = function(lat, lng) {\nL.popup()\n        .setLatLng([lat, lng])\n        .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./SectorA22.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n      \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Registro A2.2<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Lava Tree mold dispuesto de manera subvertical. Presenta un diámetro de 14 cm y su longitud no fue posible medirla. Debido a su disposición en el flujo, se atribuye a un registro in situ (no fue arrasado por el flujo de lava), su base no es posible observarla.<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA2Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n        )\n        .openOn(map);\n    }\n\n    // Función para abrir el popup del Sector A 3\n   window.openSectorA3Popup = function(lat, lng) {\nL.popup()\n    .setLatLng([lat, lng])\n    .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./SectorA3.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n      \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Sector A3<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>Corresponde a la entrada principal al interior de la  cueva Ana Te Pahu, la litología corresponde a un flujo de lava basáltica de tipo AA. En el techo se observa una estructura cilíndrica de 2.46 m y 30 cm, correspondiente a un Lava Tree.<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorA0Popup(-27.1117067, -109.4041757)'>Volver<\/a><\/p>\"\n    )\n    .openOn(map);\n}\n\n\n    // Función para abrir el popup del Sector B1\n   window.openSectorB1Popup = function(lat, lng) {\nL.popup()\n    .setLatLng([lat, lng])\n    .setContent(\n      \"<div style='border: 2px solid #333; padding: 5px; box-shadow: 3px 3px 5px #888; font-family: Times New Roman; text-align: justify;'>\" +\n      \"<img src='./SectorB1.png' width='283px' style='border: 2px solid #333; border-radius: 5px;'>\" +\n      \"<br><h2 style='color: #2C3E50; margin-top: 10px; margin-bottom: 0px;'>Sector Runga Va’e<\/h2>\" +\n      \"<p style='font-size: 14px; color: #34495E; margin-top: 4px; margin-bottom: 4px;'>A) Sobre el contacto litológico en el flujo superior pillow lavas?, se sitúa un lava tree mold de aproximadamente 3 metros de extensión y B) 52 cm de diámetro. C) Presenta una impresión de patrón de cicatrices foliares de palmera.<\/p>\"+\n      \"<p style='text-align: right;'><a href='#' onclick='openSectorBPopup(-27.139335, -109.316497)'>Volver<\/a><\/p>\"\n     )\n    .openOn(map);\n} \n  }\n).call(this.getMap(), el, x, data);\n}","data":null}]}}</script>
